import {BrowserRouter, Route, Routes} from 'react-router-dom'
import Home from './pages/Home'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div className="pages">
          <Routes>
              <Route path="/" element={<Home/>}></Route>
          </Routes>

        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
